s($,"bjg","b1O",()=>A.b([A.iT("Beef is the culinary name for meat from cattle, particularly skeletal muscle. Humans have been eating beef since prehistoric times. Beef is a source of high-quality protein and essential nutrients.","1","Beef","https://www.themealdb.com/images/category/beef.png"),A.iT("Chicken is a type of domesticated fowl. It is one of the most common and widespread domestic animals, kept for meat and eggs.","2","Chicken","https://www.themealdb.com/images/category/chicken.png"),A.iT("Dessert is a course that concludes a meal. It usually consists of sweet foods, such as cakes, fruit, and confections.","3","Dessert","https://www.themealdb.com/images/category/dessert.png"),A.iT("Lamb, hogget, and mutton are the meat of domestic sheep. The term mutton is used for the meat of adult sheep.","4","Lamb","https://www.themealdb.com/images/category/lamb.png"),A.iT("General foods that don't fit into another category.","5","Miscellaneous","https://www.themealdb.com/images/category/miscellaneous.png"),A.iT("Pasta is a staple of Italian cuisine. It is typically made from durum wheat flour and cooked by boiling or baking.","6","Pasta","https://www.themealdb.com/images/category/pasta.png"),A.iT("Pork is the culinary name for meat from a domestic pig. It is the most commonly consumed meat worldwide.","7","Pork","https://www.themealdb.com/images/category/pork.png"),A.iT("Seafood includes fish and shellfish consumed as food. Edible sea plants are also considered seafood in some regions.","8","Seafood","https://www.themealdb.com/images/category/seafood.png"),A.iT("A side dish accompanies the main course. Common sides include salad, potatoes, rice, and couscous.","9","Side","https://www.themealdb.com/images/category/side.png"),A.iT("A starter is served before the main course. In some regions, it may be a soup, salad, or appetizer dish.","10","Starter","https://www.themealdb.com/images/category/starter.png"),A.iT("Veganism avoids the use of animal products in diet and lifestyle. This includes meat, dairy, eggs, and more.","11","Vegan","https://www.themealdb.com/images/category/vegan.png"),A.iT("Vegetarians avoid meat but may consume dairy and/or eggs. Motivations include ethics, health, and environment.","12","Vegetarian","https://www.themealdb.com/images/category/vegetarian.png"),A.iT("Breakfast is the first meal of the day, typically eaten in the morning. Menus vary by culture and region.","13","Breakfast","https://www.themealdb.com/images/category/breakfast.png"),A.iT("Goats are domesticated animals used for milk, meat, and skins. Goat meat is common in many global cuisines.","14","Goat","https://www.themealdb.com/images/category/goat.png")],A.ag("D<Dm>")))
r($,"bk1","b22",()=>A.b([A.am('The chicken is a type of domesticated fowl, a subspecies of the red junglefowl (Gallus gallus). It is one of the most common and widespread domestic animals, with a total population of more than 19 billion as of 2011. There are more chickens in the world than any other bird or domesticated fowl. Humans keep chickens primarily as a source of food (consuming both their meat and eggs) and, less commonly, as pets. Originally raised for cockfighting or for special ceremonies, chickens were not kept for food until the Hellenistic period (4th\u20132nd centuries BC). Genetic studies have pointed to multiple maternal origins in South Asia, Southeast Asia, and East Asia, but with the clade found in the Americas, Europe, the Middle East and Africa originating in the Indian subcontinent. From ancient India, the domesticated chicken spread to Lydia in western Asia Minor, and to Greece by the 5th century BC. Fowl had been known in Egypt since the mid-15th century BC, with the "bird that gives birth every day" having come to Egypt from the land between Syria and Shinar, Babylonia, according to the annals of Thutmose III.',"Chicken"),A.am("Salmon is the common name for several species of ray-finned fish in the family Salmonidae. Other fish in the same family include trout, char, grayling and whitefish. Salmon are native to tributaries of the North Atlantic (genus Salmo) and Pacific Ocean (genus Oncorhynchus). Many species of salmon have been introduced into non-native environments such as the Great Lakes of North America and Patagonia in South America. Salmon are intensively farmed in many parts of the world. Typically, salmon are anadromous: they hatch in fresh water, migrate to the ocean, then return to fresh water to reproduce. However, populations of several species are restricted to fresh water through their lives. Folklore has it that the fish return to the exact spot where they hatched to spawn. Tracking studies have shown this to be mostly true. A portion of a returning salmon run may stray and spawn in different freshwater systems; the percent of straying depends on the species of salmon. Homing behavior has been shown to depend on olfactory memory. Salmon date back to the Neogene.","Salmon"),A.am("Beef is the culinary name for meat from cattle, particularly skeletal muscle. Humans have been eating beef since prehistoric times. Beef is a source of high-quality protein and nutrients. Most beef skeletal muscle meat can be used as is by merely cutting into certain parts, such as roasts, short ribs or steak (filet mignon, sirloin steak, rump steak, rib steak, rib eye steak, hanger steak, etc.), while other cuts are processed (corned beef or beef jerky). Trimmings, on the other hand, are usually mixed with meat from older, leaner (therefore tougher) cattle, are ground, minced or used in sausages. The blood is used in some varieties called blood sausage. Other parts that are eaten include other muscles and offal, such as the oxtail, liver, tongue, tripe from the reticulum or rumen, glands (particularly the pancreas and thymus, referred to as sweetbread), the heart, the brain (although forbidden where there is a danger of bovine spongiform encephalopathy, BSE, commonly referred to as mad cow disease), the kidneys, and the tender testicles of the bull (known in the United States as calf fries, prairie oysters, or Rocky Mountain oysters). Some intestines are cooked and eaten as is, but are more often cleaned and used as natural sausage casings. The bones are used for making beef stock.","Beef"),A.am("Pork is the culinary name for the flesh of a domestic pig (Sus scrofa domesticus). It is the most commonly consumed meat worldwide,[1] with evidence of pig husbandry dating back to 5000 BC. Pork is eaten both freshly cooked and preserved. Curing extends the shelf life of the pork products. Ham, smoked pork, gammon, bacon and sausage are examples of preserved pork. Charcuterie is the branch of cooking devoted to prepared meat products, many from pork. Pig is the most popular meat in the Eastern and non-Muslim parts of Southeastern Asia (Indochina, Philippines, Singapore, East Timor) and is also very common in the Western world, especially in Central Europe. It is highly prized in Asian cuisines for its fat content and pleasant texture. Consumption of pork is forbidden by Jewish, Muslim and Rastafarian dietary law, for religious reasons, with several suggested possible causes.","Pork"),A.am("The avocado, a tree with probable origin in South Central Mexico, is classified as a member of the flowering plant family Lauraceae. The fruit of the plant, also called an avocado (or avocado pear or alligator pear), is botanically a large berry containing a single large seed. Avocados are commercially valuable and are cultivated in tropical and Mediterranean climates throughout the world. They have a green-skinned, fleshy body that may be pear-shaped, egg-shaped, or spherical. Commercially, they ripen after harvesting. Avocado trees are partially self-pollinating, and are often propagated through grafting to maintain predictable fruit quality and quantity. In 2017, Mexico produced 34% of the world supply of avocados.","Avocado"),A.am("Apple cider vinegar, or cider vinegar, is a vinegar made from fermented apple juice, and used in salad dressings, marinades, vinaigrettes, food preservatives, and chutneys. It is made by crushing apples, then squeezing out the juice. Bacteria and yeast are added to the liquid to start the alcoholic fermentation process, which converts the sugars to alcohol. In a second fermentation step, the alcohol is converted into vinegar by acetic acid-forming bacteria (Acetobacter species). Acetic acid and malic acid combine to give vinegar its sour taste. Apple cider vinegar has no medicinal or nutritional value. There is no high-quality clinical evidence that regular consumption of apple cider vinegar helps to maintain or lose body weight, or is effective to manage blood glucose and lipid levels.","Apple Cider Vinegar"),A.am("Asparagus, or garden asparagus, folk name sparrow grass, scientific name Asparagus officinalis, is a perennial flowering plant species in the genus Asparagus. Its young shoots are used as a spring vegetable. It was once classified in the lily family, like the related Allium species, onions and garlic. However, genetic research places lilies, Allium, and asparagus in three separate families\u2014the Liliaceae, Amaryllidaceae, and Asparagaceae, respectively\u2014with the Amaryllidaceae and Asparagaceae being grouped together in the order Asparagales. Sources differ as to the native range of Asparagus officinalis, but generally include most of Europe and western temperate Asia. It is widely cultivated as a vegetable crop.","Asparagus"),A.am("Eggplant (US, Australia), aubergine (UK), or brinjal (South Asia and South Africa) is a plant species in the nightshade family Solanaceae. Solanum melongena is grown worldwide for its edible fruit. Most commonly purple, the spongy, absorbent fruit is used in various cuisines. Although often considered a vegetable, it is a berry by botanical definition. As a member of the genus Solanum, it is related to tomato and potato. Like the tomato, its skin and seeds can be eaten, but, like the potato, it is usually eaten cooked. Eggplant is nutritionally low in macronutrient and micronutrient content, but the capability of the fruit to absorb oils and flavors into its flesh through cooking expands its use in the culinary arts. It was originally domesticated from the wild nightshade species thorn or bitter apple, S. incanum, probably with two independent domestications: one in South Asia, and one in East Asia.","Aubergine"),A.am("The tomato is the edible, often red, berry of the plant Solanum lycopersicum, commonly known as a tomato plant. The species originated in western South America and Central America. The Nahuatl (Aztec language) word tomatl gave rise to the Spanish word tomate, from which the English word tomato derived.[3][4] Its domestication and use as a cultivated food may have originated with the indigenous peoples of Mexico. The Aztecs used tomatoes in their cooking at the time of the Spanish conquest of the Aztec Empire, and after the Spanish encountered the tomato for the first time after their contact with the Aztecs, they brought the plant to Europe. From there, the tomato was introduced to other parts of the European-colonized world during the 16th century.","Baby Plum Tomatoes"),A.am('Bacon is a type of salt-cured pork. Bacon is prepared from several different cuts of meat, typically from the pork belly or from back cuts, which have less fat than the belly. It is eaten on its own, as a side dish (particularly in breakfasts), or used as a minor ingredient to flavour dishes (e.g., the club sandwich). Bacon is also used for barding and larding roasts, especially game, including venison and pheasant. The word is derived from the Old High German bacho, meaning "buttock", "ham" or "side of bacon", and is cognate with the Old French bacon.',"Bacon"),A.am("Baking powder is a dry chemical leavening agent, a mixture of a carbonate or bicarbonate and a weak acid. The base and acid are prevented from reacting prematurely by the inclusion of a buffer such as cornstarch. Baking powder is used to increase the volume and lighten the texture of baked goods. It works by releasing carbon dioxide gas into a batter or dough through an acid-base reaction, causing bubbles in the wet mixture to expand and thus leavening the mixture. The first single-acting baking powder was developed by Birmingham based food manufacturer Alfred Bird in England in 1843. The first double-acting baking powder was developed by Eben Norton Horsford in America in the 1860s.","Baking Powder"),A.am("Balsamic vinegar (Italian: aceto balsamico), occasionally shortened to balsamic, is a very dark, concentrated, and intensely flavoured vinegar originating in Italy, made wholly or partially from grape must. Grape must is freshly crushed grape juice with all the skins, seeds and stems.","Balsamic Vinegar"),A.am("Basil, also called great basil, is a culinary herb of the family Lamiaceae (mints). Basil is native to tropical regions from central Africa to Southeast Asia. It is a tender plant, and is used in cuisines worldwide. Depending on the species and cultivar, the leaves may taste somewhat like anise, with a strong, pungent, often sweet smell.","Basil"),A.am("Basil, also called great basil, is a culinary herb of the family Lamiaceae (mints).","Basil Leaves"),A.am("Basmati is a variety of long, slender-grained aromatic rice which is traditionally from the Indian subcontinent. As of 2018-19, India exported to over 90% of the overseas basmati rice market, while Pakistan accounted for the remainder, according to the Indian state-run Agricultural and Processed Food Products Export Development Authority and the Pakistan government-run Economic Survey of Pakistan. Many countries use domestically grown basmati rice crops; however, basmati is geographically exclusive to select districts of India, Pakistan, Nepal and Bangladesh.","Basmati Rice"),A.am("The bay leaf is an aromatic leaf commonly used in cooking. It can be used whole, or as dried and ground.","Bay Leaves"),A.am("Beef brisket is one of the most beloved cuts of beef, known for its rich flavor, tenderness, and versatility in cooking. Taken from the lower chest area of the cow, brisket is naturally tough due to the abundance of connective tissue, but when cooked properly, it transforms into an incredibly juicy and melt-in-your-mouth experience. This cut is often associated with slow cooking methods such as smoking, braising, or roasting, which allow the collagen to break down and enhance the meat\u2019s succulence. Brisket is the star of many iconic dishes around the world, from Texas-style smoked barbecue to Vietnamese ph\u1edf and Jewish holiday brisket. Its deep, beefy taste pairs wonderfully with aromatic spices, smoky marinades, or even a simple salt-and-pepper rub. Because it absorbs flavors so well, brisket can be prepared in countless ways to suit different cuisines. Whether sliced thin against the grain, shredded for sandwiches, or simmered in a hearty stew, beef brisket brings comfort and satisfaction to the table. It is a timeless cut that showcases the magic of patience in cooking, turning a humble piece of meat into a flavorful centerpiece.","Beef Brisket"),A.am("Beef fillet, also known as tenderloin, is one of the most prized cuts of beef due to its unmatched tenderness and delicate flavor. Located along the spine, this muscle does very little work, resulting in a melt-in-your-mouth texture that makes it highly sought after in fine dining and gourmet cooking. Unlike fattier cuts such as ribeye, beef fillet is lean, with a subtle flavor that allows it to pair beautifully with a wide range of sauces, herbs, and seasonings. Because of its tenderness, it is often prepared as filet mignon, beef wellington, or simply seared to perfection with a light seasoning of salt and pepper. Chefs often cook it to medium-rare to preserve its natural juiciness and buttery texture. Though more expensive than other cuts, its elegance and refinement make it a centerpiece for celebratory meals, romantic dinners, or special occasions. Whether grilled, roasted, or pan-seared, beef fillet delivers a luxurious dining experience with every bite.","Beef Fillet"),A.am("Beef gravy is a rich, savory sauce made from the natural juices released during the cooking of beef, often enhanced with stock, flour, butter, and aromatic seasonings. It serves as the perfect complement to roasted or braised meats, providing depth of flavor and moisture that elevates even the simplest dish. Traditionally, beef gravy begins with pan drippings, which are whisked together with flour to create a roux, then slowly blended with beef stock until smooth and velvety. The result is a deeply flavorful sauce that carries the essence of roasted beef, with notes of caramelization and umami richness. Herbs like thyme, rosemary, or bay leaves may be added for extra aroma, while a splash of wine or Worcestershire sauce can bring an additional layer of complexity. Beef gravy is most often enjoyed poured generously over roast beef, mashed potatoes, Yorkshire pudding, or meatloaf, tying all the elements of a hearty meal together. Comforting, warming, and deeply satisfying, it embodies the essence of traditional home cooking.","Beef Gravy"),A.am("Beef stock is a rich, flavorful liquid that forms the foundation of countless soups, stews, sauces, and gravies. Made by simmering beef bones, often with bits of meat still attached, along with aromatic vegetables like onions, carrots, and celery, it develops a deep, savory taste over several hours of slow cooking. The long simmering process allows the collagen from the bones to break down, creating a silky texture and a body that water or simple broth cannot match. Often seasoned lightly with herbs such as bay leaves, thyme, and parsley, beef stock is kept versatile so it can complement a wide range of dishes. Its depth of flavor adds warmth and complexity, transforming simple ingredients into hearty, comforting meals. Home cooks and professional chefs alike treasure beef stock not just as a cooking liquid but as an essential building block of culinary creativity. Whether used to enrich a risotto, form the base of a rich beef gravy, or enhance the taste of braised meats, beef stock remains one of the most fundamental and irreplaceable elements of traditional cooking.","Beef Stock"),A.am("Sodium bicarbonate, commonly known as baking soda, is a chemical compound with the formula NaHCO3. It is a salt composed of a sodium cation (Na+) and a bicarbonate anion (HCO3\u2212). Sodium bicarbonate is a white solid that is crystalline, but often appears as a fine powder. It has a slightly salty, alkaline taste resembling that of washing soda (sodium carbonate). The natural mineral form is nahcolite. It is a component of the mineral natron and is found dissolved in many mineral springs.","Bicarbonate Of Soda"),A.am("Biryani, also known as biriyani, biriani, birani or briyani, is a mixed rice dish with its origins among the Muslims of the Indian subcontinent. It can be compared to mixing a curry, later combining it with semi-cooked rice separately. This dish is especially popular throughout the Indian subcontinent, as well as among the diaspora from the region. It is also prepared in other regions such as Iraqi Kurdistan. It is made with Indian spices, rice, meat (chicken, goat, beef, lamb, prawn, or fish), vegetables or eggs.","Biryani Masala"),A.am("Black pepper (Piper nigrum) is a flowering vine in the family Piperaceae, cultivated for its fruit, known as a peppercorn, which is usually dried and used as a spice and seasoning. When fresh and fully mature, it is about 5 mm (0.20 in) in diameter and dark red, and contains a single seed, like all drupes. Peppercorns and the ground pepper derived from them may be described simply as pepper, or more precisely as black pepper (cooked and dried unripe fruit), green pepper (dried unripe fruit), or white pepper (ripe fruit seeds). Black pepper is native to present-day Kerala in Southwestern India, and is extensively cultivated there and elsewhere in tropical regions. Vietnam is the world's largest producer and exporter of pepper, producing 34% of the world's crop, as of 2013.","Black Pepper"),A.am('Molasses (American English) or black treacle (British English) is a viscous product resulting from refining sugarcane or sugar beets into sugar. Molasses varies by amount of sugar, method of extraction, and age of plant. Sugarcane molasses is primarily used for sweetening and flavoring foods in the United States, Canada, and elsewhere. Molasses is a defining component of fine commercial brown sugar. Sweet sorghum syrup may be colloquially called "sorghum molasses" in the southern United States.[2][3] Similar products include honey, maple syrup, corn syrup, and invert syrup. Most of these alternative syrups have milder flavors.',"Black Treacle"),A.am("Eggplant (Solanum melongena) or aubergine is a species of nightshade grown for its edible fruit. Eggplant is the common name in North America, Australia and New Zealand; in British English, it is aubergine, and in South Asia and South Africa, brinjal. The fruit is widely used in cooking. As a member of the genus Solanum, it is related to the tomato and the potato. It was originally domesticated from the wild nightshade species, the thorn or bitter apple, S. incanum, probably with two independent domestications, one in South Asia and one in East Asia.","Baby Aubergine"),A.am("Paella[a] is a Valencian rice dish that has ancient roots but its modern form originated in the mid-19th century in the area around Albufera lagoon on the east coast of Spain, adjacent to the city of Valencia. Many non-Spaniards view paella as Spain's national dish, but most Spaniards consider it to be a regional Valencian dish. Valencians, in turn, regard paella as one of their identifying symbols. Types of paella include Valencian paella, vegetable paella (Spanish: paella de verduras), seafood paella (Spanish: paella de mariscos), and mixed paella (Spanish: paella mixta), among many others. Valencian paella is believed to be the original recipe and consists of white rice, green beans (bajoqueta and tavella), meat (chicken, duck and rabbit), white beans (garrof\xf3n), snails, and seasoning such as saffron and rosemary. Another very common but seasonal ingredient is artichokes. Seafood paella replaces meat with seafood and omits beans and green vegetables. Mixed paella is a free-style combination of meat from land animals, seafood, vegetables, and sometimes beans. Most paella chefs use bomba rice due to it being less likely to overcook, but Valencians tend to use a slightly stickier (and thus more susceptible to overcooking) variety known as Senia. All types of paellas use olive oil.","Paella Rice"),A.am("Scotch bonnet, also known as bonney peppers, or Caribbean red peppers, is a variety of chili pepper named for its resemblance to a tam o' shanter hat. Also called ata rodo by Yoruba speakers of Nigeria, it is found mainly in the Caribbean islands; it is also found in Guyana (where it is called the ball-of-fire pepper), the Maldives Islands (where it is called githeyo mirus), Panama (where it is called aji chombo) and West Africa. Most Scotch bonnets have a heat rating of 100,000\u2013350,000 Scoville units. For comparison, most jalape\xf1o peppers have a heat rating of 2,500 to 8,000 on the Scoville scale. However, completely sweet varieties of Scotch bonnet are grown on some of the Caribbean islands, called cachucha peppers. These peppers are used to flavour many different dishes and cuisines worldwide and are often used in hot sauces and condiments. The Scotch bonnet has a sweeter flavour and stouter shape, distinct from its habanero relative with which it is often confused, and gives jerk dishes (pork/chicken) and other Caribbean dishes their unique flavour. Scotch bonnets are mostly used in West African, Antiguan, Kittitian/Nevisian, Anguilan, Dominican, St. Lucian, St Vincentian, Grenadian, Trinidadian, Jamaican, Barbadian, Guyanese, Surinamese, Haitian and Cayman cuisines and pepper sauces, though they often show up in other Caribbean recipes. It is also used in Costa Rica and Panama for Caribbean-styled recipes such as rice and beans, Rond\xf3n, saus, beef patties, and Ceviche. Fresh, ripe Scotch bonnets can change from green to yellow to scarlet red, however many other breeds of this pepper can ripen to orange, yellow, peach, or even a chocolate brown.","Scotch Bonnet"),A.am("Eggs are one of the most versatile ingredients in cooking, valued for their delicate taste, nutritional richness, and wide range of uses. Packed with protein, healthy fats, and essential vitamins, eggs provide both nourishment and structure in countless dishes. When cooked simply, such as boiled, poached, or fried, eggs deliver comforting flavors and satisfying textures. In baking, they play a vital role by binding ingredients together, adding moisture, and helping doughs and batters rise to create light and airy results. Whipped egg whites bring lift to meringues and souffl\xe9s, while yolks add creaminess to sauces like hollandaise or custards. Beyond their culinary uses, eggs symbolize simplicity and tradition across many cultures, often serving as a staple in everyday meals. Whether enjoyed at breakfast, blended into rich desserts, or used to coat and crisp savory dishes, the egg stands out as an ingredient that is both humble and essential, elevating recipes with its subtle richness and natural balance.","Egg"),A.am("Butter is a cornerstone of both sweet and savory cooking, known for its rich flavor and creamy texture. Made by churning cream, butter contains a balance of fat and milk solids that give it its signature smoothness and depth. Its taste can range from delicately sweet to slightly nutty, especially when browned, making it a powerful ingredient for enhancing flavors. In baking, butter contributes to flaky pastries, tender cakes, and chewy cookies, while in cooking it creates silky sauces and adds richness when melted over vegetables, meats, or grains. Spread on fresh bread, it delivers instant comfort, while used in saut\xe9ing, it imparts a subtle golden flavor that elevates simple ingredients. Butter is also celebrated in cultural traditions, from French patisserie to Indian ghee, showing its universal importance in global cuisine. Whether it\u2019s the base of a creamy sauce, the secret to a flaky pie crust, or simply melted on warm toast, butter offers a warmth and indulgence that few ingredients can match.","Butter"),A.am("Cheese is one of the world\u2019s most beloved ingredients, offering an incredible diversity of flavors, textures, and aromas. Created through the process of fermenting milk, cheese ranges from soft and mild varieties like mozzarella or brie to sharp and aged classics such as cheddar or parmesan. Its flavor spectrum spans creamy, salty, tangy, nutty, and even pungent notes, making it a versatile addition to almost any dish. Melted cheese provides indulgent stretch and creaminess in pastas, sandwiches, and pizzas, while crumbled or shaved cheese adds a sharp accent to salads and soups. Beyond its taste, cheese is rich in protein, calcium, and essential nutrients, making it both flavorful and nourishing. Different cultures have their own iconic cheeses, each with unique character shaped by tradition and technique, from Italian ricotta to French camembert to Greek feta. Whether enjoyed as a simple snack, paired with wine, or used as the star of a dish, cheese enhances meals with depth, richness, and irresistible flavor.","Cheese"),A.am('Oxtail (occasionally spelled ox tail or ox-tail) is the culinary name for the tail of cattle. Formerly, it referred only to the tail of an ox or steer, a bullock (a castrated male).[citation needed] An oxtail typically weighs 2 to 4 lbs. (1\u20131.8 kg) and is skinned and cut into short lengths for sale. Oxtail is a bony, gelatin-rich meat, which is usually slow-cooked as a stew[1] or braised. It is a traditional stock base for a soup. Traditional preparations involve slow cooking, so some modern recipes take a shortcut using a pressure cooker. Oxtail is the main ingredient of the Italian dish coda alla vaccinara (a classic of Roman cuisine). It is a popular flavour for powder, instant and premade canned soups in the United Kingdom and Ireland. Oxtails are also one of the popular bases for Russian aspic appetizer dishes (\u0445\u043e\u043b\u043e\u0434\u0435\u0446 or \u0441\u0442\u0443\u0434\u0435\u043d\u044c), along with pig trotters or ears or cow "knees", but are the preferred ingredients among Russian Jews because they can be Kosher. Versions of oxtail soup are popular traditional dishes in South America, West Africa, China, Spain [2] and Indonesia. In Chinese cuisine, it\'s usually made into a soup called \u725b\u5c3e\u6c64 (ni\xfaw\u011bi t\u0101ng, "oxtail soup"). In Korean cuisine, a soup made with oxtail is called kkori gomtang (see gomguk). It is a thick soup seasoned with salt and eaten with a bowl of rice. It can be used as a stock for making tteokguk (rice cake soup). Stewed oxtail with butter bean or as main dish (with rice) is popular in Jamaica, Trinidad, and other West Indian cultures. Oxtail is also very popular in South Africa where it is often cooked in a traditional skillet called a potjie, which is a three-legged cast iron pot placed over an open fire. Oxtail is also eaten in other southern parts of Africa like Zimbabwe and served with sadza and greens. In the United States, oxtail is a mainstay in African American and West Indian households. In Cuban cuisine, a stew can be made from oxtail called rabo encendido. In the Philippines, it is prepared in a peanut based stew called Kare-kare. In Iran, Oxtail is slow-cooked and served as a substitute for shank in a main dish called Baghla-Poli-Mahicheh which is prepared with rice, shank (or oxtail) and a mixture of herbs including dill, coriander, parsley and garlic. In the United States, oxtail has the meat-cutting classification NAMP 1791.',"Oxtail"),A.am("Vicia faba, also known as the broad bean, fava bean, faba bean, field bean, bell bean, or tic bean, is a species of flowering plant in the pea and bean family Fabaceae. It is native to North Africa[dubious \u2013 discuss] southwest and south Asia, and extensively cultivated elsewhere.[citation needed] A variety Vicia faba var. equina Pers. \u2013 horse bean has been previously recognized.","Broad Beans"),A.am("The northern red snapper (Lutjanus campechanus) is a species of snapper native to the western Atlantic Ocean including the Gulf of Mexico, where it inhabits environments associated with reefs. This species is commercially important and is also sought-after as a game fish. The northern red snapper's body is very similar in shape to other snappers, such as the mangrove snapper, mutton snapper, lane snapper, and dog snapper. All feature a sloped profile, medium-to-large scales, a spiny dorsal fin, and a laterally compressed body. Northern red snapper have short, sharp, needle-like teeth, but they lack the prominent upper canine teeth found on the mutton, dog, and mangrove snappers. This snapper reaches maturity at a length of about 39 cm (15 in). The common adult length is 60 cm (24 in), but may reach 100 cm (39 in). The maximum published weight is 38 kg (84 lb), and the oldest reported age is 100+ years. Coloration of the northern red snapper is light red, with more intense pigment on the back. It has 10 dorsal spines, 14 soft dorsal rays, three anal spines and eight to 9 anal soft rays. Juvenile fish (shorter than 30\u201335 cm) can also have a dark spot on their sides, below the anterior soft dorsal rays, which fades with age.","Red Snapper"),A.am("Vinegar is a liquid consisting of about 5\u201320% acetic acid (CH3COOH), water, and other trace chemicals, which may include flavorings. The acetic acid is produced by the fermentation of ethanol by acetic acid bacteria. Vinegar is now mainly used as a cooking ingredient, or in pickling. As the most easily manufactured mild acid, it has historically had a great variety of industrial, medical, and domestic uses, some of which (such as its use as a general household cleaner) are still commonly practiced today. Commercial vinegar is produced either by a fast or a slow fermentation process. In general, slow methods are used in traditional vinegars where fermentation proceeds slowly over the course of a few months or up to a year. The longer fermentation period allows for the accumulation of a non-toxic slime composed of acetic acid bacteria. Fast methods add mother of vinegar (bacterial culture) to the source liquid before adding air to oxygenate and promote the fastest fermentation. In fast production processes, vinegar may be produced between 20 hours to three days.","Vinegar"),A.am("Rice vinegar is a vinegar made from fermented rice in China, Japan, Korea, and Vietnam. Chinese rice vinegars are stronger than Japanese ones, and range in colour from clear to various shades of red, brown and black and are therefore known as rice wine vinegar. Chinese and especially Japanese vinegars are less acidic than the distilled Western vinegars which, for that reason, are not appropriate substitutes for rice vinegars. The majority of the Asian rice vinegar types are also more mild and sweet than vinegars typically used in the Western world, with black vinegars as a notable exception. Chinese rice vinegars are made from huangjiu, a type of rice wine.","Rice Vinegar"),A.am("Eleocharis dulcis, the Chinese water chestnut or water chestnut, is a grass-like sedge native to Asia (China, Japan, India, Philippines, etc.), Australia, tropical Africa, and various islands of the Pacific and Indian Oceans. It is grown in many countries for its edible corms. The water chestnut is not a nut at all, but an aquatic vegetable that grows in marshes, under water, in the mud. It has stem-like, tubular green leaves that grow to about 1.5 m. The water caltrop, which also is referred to by the same name, is unrelated and often confused with the water chestnut. The small, rounded corms have a crisp, white flesh and may be eaten raw, slightly boiled, or grilled, and often are pickled or tinned. They are a popular ingredient in Chinese dishes. In China, they are most often eaten raw, sometimes sweetened. They also may be ground into a flour form used for making water chestnut cake, which is common as part of dim sum cuisine. They are unusual among vegetables for remaining crisp even after being cooked or canned, because their cell walls are cross-linked and strengthened by certain phenolic compounds, such as oligomers of ferulic acid. This property is shared by other vegetables that remain crisp in this manner, including the tiger nut and lotus root. The corms contain the antibiotic agent puchiin, which is stable to high temperature. Apart from the edible corms, the leaves can be used for cattlefeed, mulch or compost. The corms are rich in carbohydrates (about 90% by dry weight), especially starch (about 60% by dry weight), and are also a good source of dietary fiber, riboflavin, vitamin B6, potassium, copper, and manganese. If eaten uncooked, the surface of the plants may transmit fasciolopsiasis.","Water Chestnut"),A.am("Tofu, also known as bean curd, is a food cultivated by coagulating soy milk and then pressing the resulting curds into soft white blocks. It is a component in East Asian and Southeast Asian cuisines. Tofu can be soft, firm, or extra firm. Tofu has a subtle flavor and can be used in savory and sweet dishes. It is often seasoned or marinated to suit the dish. Tofu has a low calorie count and relatively large amounts of protein. It is high in iron, and it can have a high calcium or magnesium content, depending on the coagulants used in manufacturing (e.g. calcium chloride, calcium sulfate, magnesium sulfate).","Tofu"),A.am('Doubanjiang (IPA: [to\u0302upa\u0302nt\u0255ja\u0302\u014b]), or simply Douban, or Toban-djan, Chili bean sauce, is a spicy, salty paste made from fermented broad beans, soybeans, salt, rice, and various spices. Doubanjiang exists in plain and spicy versions, with the latter containing red chili peppers and called la doubanjiang (\u8fa3\u8c46\u74e3\u9171; pinyin: l\xe0 d\xf2ub\xe0nji\xe0ng; l\xe0 meaning "hot" or "spicy"). It is used particularly in Sichuan cuisine, and in fact, the people of the province commonly refer to it as "the soul of Sichuan cuisine". A particularly well-known variety is called Pixian Douban (simplified Chinese: \u90eb\u53bf\u8c46\u74e3; traditional Chinese: \u90eb\u7e23\u8c46\u74e3; pinyin: P\xedxi\xe0n d\xf2ub\xe0n), named after the district of Pixian, Sichuan.[1] This sauce is sometimes stir-fried with oil and eaten with rice or noodles as a quick meal, and is also commonly used as a primary flavoring for fried tofu dishes and cold tofu salads. It is also frequently mixed with instant noodles. In many Chinese communities and food factories, doubanjiang is produced with only soybeans and salt, and does not contain the broad beans or chili peppers typical of Sichuan-style doubanjiang. In Korean cuisine, a similar form of bean paste is called doenjang.',"Doubanjiang"),A.am('Douchi (Chinese: \u8c46\u8c49; pinyin: d\xf2uch\u01d0), or tochi is a type of fermented and salted black soybean. In English, it is known as fermented black soybeans, Chinese fermented black beans (Chinese: \u9ed1\u8c46\u8c46\u8c49; pinyin: h\u0113id\xf2u d\xf2uch\u01d0), salted black beans, salty black beans, or just black beans. They are a flavoring most popular in the cuisine of China, where they are most widely used for making black bean sauce dishes.[1][page needed] Douchi is made by fermenting and salting black soybeans. The black type soybean is most commonly used and the process turns the beans soft, and mostly semi-dry (if the beans are allowed to dry). Regular soybeans (white soybeans) are also used, but this does not produce "salted black beans"; instead, these beans become brown. The smell is sharp, pungent, and spicy; the taste is salty, somewhat bitter and sweet.[citation needed] The product made with white soybeans is called mianchi. The process and product are similar to ogiri and iru, both being African fermented bean products[citation needed]. Douchi, "Chinese salted black beans", and "black soybeans" should not be confused with the black turtle bean, a variety of common bean that is commonly used in the cuisines of Central America, South America, and the Caribbean.',"Fermented Black Beans"),A.am("Scallions (green onion, spring onion and salad onion) are vegetables of various Allium onion species. Scallions have a milder taste than most onions. Their close relatives include the garlic, shallot, leek, chive, and Chinese onion. Although the bulbs of many Allium species are used as food, the defining characteristic of scallion species is that they lack a fully developed bulb. In common with all Allium species, scallions have hollow, tubular green leaves, growing directly from the bulb. These leaves are used as a vegetable; they are eaten either raw or cooked. The leaves are often chopped into other dishes, in the manner of onions or garlic. Also known as scallions or green onions, spring onions are in fact very young onions, harvested before the bulb has had a chance to swell.","Scallions"),A.am('Sichuan pepper, Sichuan peppercorn, or Szechuan pepper, is a commonly used spice in Chinese cuisine. It is derived from at least two species of the global genus Zanthoxylum, including Z. simulans and Z. bungeanum. The genus Zanthoxylum belongs in the rue or citrus family, and, despite its name, is not closely related to either black pepper nor the chili pepper. The husk or hull (pericarp) around the seeds may be used whole, especially in Sichuan cuisine, and the finely ground powder is one of the ingredients for five-spice powder. It is also used in traditional Chinese medicine. The pericarp is most often used, but the leaves of various species are also used in some regions of China. Another species of Zanthoxylum native to China, Z. schinifolium, called xi\u0101ng ji\u0101o zi (\u9999\u6912\u5b50, "aromatic peppercorn") or q\u012bng hu\u0101 ji\u0101o (\u9752\u82b1\u6912, "green flower pepper"), is used as a spice in Hebei. While the exact flavour and composition of different species from the genus Zanthoxylum vary, most share the same essential characteristics. So while the terms "Sichuan pepper" and sansh\u014d may refer specifically to Z. simulans and Z. piperitum, respectively, the two are commonly used interchangeably. Related species are used in the cuisines of Tibet, Bhutan, Nepal, Thailand, and India (the Konkani and Uttarakhandi people) and Toba Batak peoples. In Bhutan, this pepper is known as thingye and is used liberally in preparation of soups, gruels, and phaag sha paa (pork slices).[citation needed] In Nepal, timur is used in the popular foods momo, thukpa, chow mein, chicken chilli, and other meat dishes. It is also widely used in homemade pickles. People take timur as a medicine for stomach or digestion problems, in a preparation with cloves of garlic and mountain salt with warm water.',"Sichuan Pepper"),A.am("Won ton skin. Paper-thin squares of dough made from flour, water, eggs and salt used to make won tons, egg rolls and gyoza.","Wonton Skin"),A.am("Starch or amylum is a polymeric carbohydrate consisting of a large number of glucose units joined by glycosidic bonds. This polysaccharide is produced by most green plants as energy storage. It is the most common carbohydrate in human diets and is contained in large amounts in staple foods like potatoes, wheat, maize (corn), rice, and cassava. Pure starch is a white, tasteless and odorless powder that is insoluble in cold water or alcohol. It consists of two types of molecules: the linear and helical amylose and the branched amylopectin. Depending on the plant, starch generally contains 20 to 25% amylose and 75 to 80% amylopectin by weight.[4] Glycogen, the glucose store of animals, is a more highly branched version of amylopectin. In industry, starch is converted into sugars, for example by malting, and fermented to produce ethanol in the manufacture of beer, whisky and biofuel. It is processed to produce many of the sugars used in processed foods. Mixing most starches in warm water produces a paste, such as wheatpaste, which can be used as a thickening, stiffening or gluing agent. The biggest industrial non-food use of starch is as an adhesive in the papermaking process. Starch can be applied to parts of some garments before ironing, to stiffen them.","Starch"),A.am("Rice wine is an alcoholic beverage fermented and distilled from rice, traditionally consumed in East Asia, Southeast Asia and South Asia. Rice wine is made from the fermentation of rice starch that has been converted to sugars. Microbes are the source of the enzymes that convert the starches to sugar.[1] Rice wine typically has an alcohol content of 18\u201325% ABV. Rice wines are used in Asian gastronomy at formal dinners and banquets and in cooking. They are also used in a religious and ceremonial context.","Rice Wine"),A.am("Splash into casseroles, sauces and marinades for a rounded vibrant flavour.","Cooking Wine"),A.am("Duck sauce (or orange sauce) is a condiment with a sweet and sour flavor and a translucent orange appearance similar to a thin jelly. Offered at Chinese-American restaurants, it is used as a dip for deep-fried dishes such as wonton strips, spring rolls, egg rolls, duck, chicken, fish, or with rice or noodles. It is often provided in single-serving packets along with soy sauce, mustard, hot sauce or red chili powder. It may be used as a glaze on foods, such as poultry. Despite its name the sauce is not prepared using duck meat.","Duck Sauce"),A.am("Gochujang or red chili paste is a savory, sweet, and spicy fermented condiment made from chili powder, glutinous rice, meju powder, yeotgireum, and salt.","Gochujang"),A.am("Bean sprouts are a common ingredient across the world. They are particularly common in Eastern Asian cuisine. There are two types of common bean sprouts: Mung bean sprout is made from the greenish-capped mung beans Soybean sprout is made from yellow, larger-grained soybean It typically takes one week for them to become fully grown. The sprouted beans are more nutritious than the original beans and they require much less cooking time.","Bean Sprouts"),A.am("Noodles are a staple food in many cultures. They are made from unleavened dough which is stretched, extruded, or rolled flat and cut into one of a variety of shapes. While long, thin strips may be the most common, many varieties of noodles are cut into waves, helices, tubes, strings, or shells, or folded over, or cut into other shapes. Noodles are usually cooked in boiling water, sometimes with cooking oil or salt added. They are often pan-fried or deep-fried. Noodles are often served with an accompanying sauce or in a soup. Noodles can be refrigerated for short-term storage or dried and stored for future use. The material composition or geocultural origin must be specified when discussing noodles. The word derives from the German word Nudel.[1]","Noodles"),A.am('Auricularia auricula-judae, known as the Jew\'s ear, wood ear, jelly ear or by a number of other common names, is a species of edible Auriculariales fungus found worldwide. The fruiting body is distinguished by its noticeably ear-like shape and brown colouration; it grows upon wood, especially elder. Its specific epithet is derived from the belief that Judas Iscariot hanged himself from an elder tree; the common name "Judas\'s ear" was largely eclipsed by the corruption "Jew\'s ear", while today "jelly ear" and other names are sometimes used. The fungus can be found throughout the year in temperate regions worldwide, where it grows upon both dead and living wood. In the West, A. auricula-judae was used in folk medicine as recently as the 19th century for complaints including sore throats, sore eyes and jaundice, and as an astringent. Although it is not widely consumed in the West, it has long been popular in China, to the extent that Australia exported large volumes to China in the early twentieth century. Today, the fungus is a popular ingredient in many Chinese dishes, such as hot and sour soup, and also used in Chinese medicine. It is also used in Ghana, as a blood tonic. Modern research into possible medical applications has variously concluded that A. auricula-judae has antitumour, hypoglycemic, anticoagulant and cholesterol-lowering properties.',"Wood Ear Mushrooms"),A.am('Rum is a distilled alcoholic drink made from sugarcane byproducts, such as molasses, or directly from sugarcane juice, by a process of fermentation and distillation. The distillate, a clear liquid, is then usually aged in oak barrels. The majority of the world\'s rum production occurs in the Caribbean and Latin America. Rum is also produced in Australia, Portugal, Austria, Canada, Fiji, India, Japan, Mauritius, Nepal, New Zealand, the Philippines, Reunion Island, South Africa, Spain, Sweden, Taiwan, Thailand, the United Kingdom and the United States. Rums are produced in various grades. Light rums are commonly used in cocktails, whereas "golden" and "dark" rums were typically consumed straight or neat, on the rocks, or used for cooking, but are now commonly consumed with mixers. Premium rums are also available, made to be consumed either straight or iced. Rum plays a part in the culture of most islands of the West Indies as well as in The Maritimes and Newfoundland. This drink has famous associations with the Royal Navy (where it was mixed with water or beer to make grog) and piracy (where it was consumed as bumbo). Rum has also served as a popular medium of economic exchange, used to help fund enterprises such as slavery (see Triangular trade), organized crime, and military insurgencies (e.g., the American Revolution and Australia\'s Rum Rebellion).',"Rum"),A.am("English muffins are a small, round, flat yeast-leavened bread which is commonly sliced horizontally, toasted, and buttered.[2] Toasted English muffins, which are often used in the United States as a breakfast food, may be served with sweet toppings (e.g., fruit jam, or honey) or savoury toppings (e.g., eggs, sausage rounds, bacon, or cheese). English muffins are also used as the bread in a variety of breakfast sandwiches, and are an essential ingredient in Eggs Benedict and most of its variations. In the United States and U.S.-influenced territories, they are called English muffins to distinguish them from U.S. muffins, which are larger and sweeter miniature baked quick breads. They are very similar to bolo do caco in Portuguese cuisine.","English Muffins"),A.am("A muffin is an individual-sized, baked product. It can refer to two distinct items, a part-raised flatbread and a cupcake-like quickbread. The flatbread is of British or European derivation, and dates from at least the early 18th century, while the quickbread originated in North America during the 19th century. Both are common worldwide today.","Muffins"),A.am("Wine vinegar is made from red or white wine, and is the most commonly used vinegar in Southern and Central Europe, Cyprus and Israel. As with wine, there is a considerable range in quality. Better-quality wine vinegars are matured in wood for up to two years, and exhibit a complex, mellow flavor. Wine vinegar tends to have a lower acidity than white or cider vinegars. More expensive wine vinegars are made from individual varieties of wine, such as champagne, sherry, or pinot gris.","White Wine Vinegar"),A.am("Smoked salmon is a preparation of salmon, typically a fillet that has been cured and hot or cold smoked. Due to its moderately high price, smoked salmon is considered a delicacy. Although the term lox is sometimes applied to smoked salmon, they are different products.","Smoked Salmon"),A.am("Mars is a variety of chocolate bar produced by Mars, Incorporated. It was first manufactured in 1932 in Slough, England by Forrest Mars, Sr. The bar was sold in two different formulations. In its original British version the bar consists of milk chocolate surrounding caramel and nougat, developed to resemble the American candy bar known as the Milky Way, which had been introduced a decade earlier. An American version of the Mars Bar was produced which had nougat and toasted almonds covered in milk chocolate; later, caramel was added to the recipe as well. The American version was discontinued in 2002, though it has been revived for short runs since then.","Mars Bar"),A.am('Rice Krispies (also known as Rice Bubbles in Australia and New Zealand) is a breakfast cereal marketed by Kellogg\'s in 1927 and released to the public in 1928. Rice Krispies are made of crisped rice (rice and sugar paste that is formed into rice shapes or "berries", cooked, dried and toasted), and expand forming very thin and hollowed out walls that are crunchy and crisp. When milk is added to the cereal the walls tend to collapse, creating the "Snap, crackle and pop" sounds. Rice Krispies cereal has a long advertising history, with the elf cartoon characters Snap, Crackle and Pop touting the brand. In 1963, The Rolling Stones recorded a short song for a Rice Krispies television advertisement.',"Rice Krispies"),A.am("The almond (Prunus dulcis, syn. Prunus amygdalus) is a species of tree native to Mediterranean climate regions of the Middle East, but widely cultivated elsewhere. The almond is also the name of the edible and widely cultivated seed of this tree. Within the genus Prunus, it is classified with the peach in the subgenus Amygdalus, distinguished from the other subgenera by corrugations on the shell (endocarp) surrounding the seed. The fruit of the almond is a drupe, consisting of an outer hull and a hard shell with the seed, which is not a true nut, inside. Shelling almonds refers to removing the shell to reveal the seed. Almonds are sold shelled or unshelled. Blanched almonds are shelled almonds that have been treated with hot water to soften the seedcoat, which is then removed to reveal the white embryo.","Almond Extract"),A.am("Milk is a highly nutritious liquid produced by mammals, most commonly cows, and has been a staple food across cultures for centuries. It provides essential nutrients like calcium, protein, potassium, and vitamins D and B12, making it vital for bone health, muscle repair, and overall growth. Milk is consumed in many forms: fresh, pasteurized, or powdered, and is used in countless recipes, from creamy soups to baked goods. It also serves as the base for dairy products like cheese, butter, yogurt, and cream. In addition to being a beverage, milk enhances flavors and textures in cooking, giving richness to sauces and smoothness to desserts. Varieties like whole milk, skim milk, or lactose-free options cater to different dietary needs. Beyond nutrition, milk carries cultural significance\u2014used in rituals, traditions, and hospitality worldwide. Its versatility, nutrient density, and ability to pair with sweet and savory dishes make it one of the most indispensable ingredients in kitchens across the globe.","Milk"),A.am("Oranges are citrus fruits celebrated for their bright flavor, juiciness, and refreshing aroma. Rich in vitamin C, fiber, and antioxidants, they are excellent for boosting immunity, supporting skin health, and aiding digestion. Oranges come in many varieties, from sweet navel oranges to tangy blood oranges, each offering unique taste profiles. They are eaten fresh, juiced, or used in both savory and sweet recipes, such as salads, marinades, cakes, and sauces. Orange zest adds a fragrant, tangy kick to baked goods, while the juice can balance flavors in savory glazes or cocktails. Oranges also hold symbolic importance in many cultures, often representing prosperity, energy, and renewal. Beyond their culinary uses, oranges are valued in the production of essential oils and natural fragrances. Their refreshing, tangy-sweet flavor and high nutritional value make oranges a versatile ingredient that brings brightness, vibrancy, and natural sweetness to a wide variety of dishes and drinks around the world.","Orange"),A.am("Bananas are one of the world\u2019s most popular fruits, known for their natural sweetness, creamy texture, and convenience as a portable snack. Packed with potassium, vitamin B6, and dietary fiber, they help maintain healthy blood pressure, support heart health, and aid digestion. Bananas come in many varieties, from the small and sweet Lady Finger banana to the starchier plantain used in cooking. They can be eaten raw, blended into smoothies, or incorporated into baked goods like banana bread, muffins, and pancakes. In savory dishes, bananas or plantains are fried, boiled, or roasted to accompany meals, especially in tropical cuisines. Their natural sugars provide quick energy, making them a favorite among athletes. Bananas also pair wonderfully with dairy, chocolate, nuts, and cereals, enhancing both desserts and breakfast dishes. Beyond nutrition, they hold cultural significance in many regions, symbolizing abundance and fertility. Simple, nourishing, and versatile, bananas remain an everyday essential for millions worldwide.","Banana"),A.am("Sugar is a crystalline carbohydrate widely used as a sweetener in cuisines across the globe. Derived from sugarcane or sugar beets, it comes in many forms: granulated, powdered, brown, and raw sugar, each with unique uses. Sugar is more than just sweetness; it enhances flavors, balances acidity, and influences texture in baking and cooking. In desserts, sugar creates caramelization, adds tenderness to cakes, and stabilizes whipped creams. In savory dishes, it balances salty, sour, or spicy elements, enriching sauces and marinades. Nutritionally, sugar provides quick energy, but excessive consumption is linked to health concerns, so moderation is important. Despite this, its role in food culture is undeniable\u2014found in traditional sweets, festive treats, and beverages worldwide. Beyond culinary applications, sugar also plays roles in preservation, fermentation, and even medicine. As both a cultural and culinary cornerstone, sugar continues to be cherished for the comfort, pleasure, and balance it brings to countless recipes.","Sugar"),A.am("Salt is one of the most essential and ancient ingredients in human history, valued for both its flavor-enhancing qualities and its ability to preserve food. Composed primarily of sodium chloride, salt has been used across civilizations not only in cooking but also in trade and cultural rituals. It sharpens and balances flavors, making dishes more vibrant and palatable. Different types of salt\u2014table salt, sea salt, Himalayan pink salt, and kosher salt\u2014offer unique textures and tastes. Beyond flavor, salt plays a critical role in baking, strengthening gluten in bread and controlling fermentation. It also supports human health by maintaining fluid balance and nerve function, though excess intake should be avoided. Salt\u2019s preserving power allowed ancient societies to store meat, fish, and vegetables long before refrigeration. In many cultures, salt symbolizes purity and hospitality. Its enduring importance in kitchens worldwide highlights its irreplaceable role as both a functional and flavorful cornerstone of cooking.","Salt"),A.am("Oil is a versatile cooking fat derived from plants, seeds, nuts, or fruits, serving as a key ingredient in cuisines worldwide. It provides energy, enhances flavor, and plays a critical role in cooking techniques such as frying, saut\xe9ing, roasting, and baking. Different oils\u2014such as olive, coconut, canola, or peanut oil\u2014bring distinct aromas and nutritional benefits. Oils act as carriers of fat-soluble vitamins A, D, E, and K, making them vital for health when used in moderation. Beyond nutrition, oil affects food texture, helping create crispy coatings, moist cakes, and smooth dressings. In many cultures, oils hold traditional and ceremonial value, often linked with prosperity or healing. They are also used outside the kitchen in skincare and medicine. While some oils are prized for their robust flavors, others remain neutral, adapting to any dish. Oil\u2019s culinary flexibility, nutritional importance, and cultural presence make it one of the most essential staples in modern and traditional kitchens alike.","Oil"),A.am("Sunflower oil is a light, golden cooking oil extracted from sunflower seeds, prized for its mild flavor and high smoke point. It is especially valued in frying, roasting, and baking, where it adds crispness without overpowering other flavors. Nutritionally, sunflower oil is rich in vitamin E and polyunsaturated fats, supporting heart health when consumed in moderation. Its neutral taste makes it a versatile base for salad dressings, marinades, and saut\xe9ed dishes. Beyond cooking, sunflower oil is used in cosmetics and skincare for its moisturizing properties. Compared to other oils, it has a lighter texture, making it a healthier choice for those seeking balance in their diet. In many cultures, sunflower oil has become a common household staple, replacing heavier oils for everyday use. Its affordability, versatility, and nutritional benefits ensure it remains one of the most widely used oils worldwide, bridging traditional kitchens and modern culinary practices seamlessly.","Sunflower Oil"),A.am("Rice is a staple food for more than half the world\u2019s population, particularly in Asia, Africa, and Latin America. It comes in many varieties\u2014long-grain, short-grain, jasmine, basmati, and sticky rice\u2014each suited to different dishes. As a carbohydrate-rich grain, rice provides a primary source of energy, while also offering small amounts of protein and essential minerals. Its neutral flavor makes it a versatile base for countless recipes, from stir-fries and curries to sushi and risotto. Rice also holds deep cultural and symbolic meaning, often associated with prosperity, fertility, and community celebrations. In cooking, rice adapts to savory and sweet dishes alike, serving as comfort food in many traditions. Beyond culinary uses, rice byproducts like rice flour and rice bran oil add further value. Affordable, nourishing, and adaptable, rice remains one of the most important and beloved ingredients in global cuisine, forming the foundation of meals across cultures and generations.","Rice"),A.am("Potatoes are root vegetables beloved worldwide for their versatility, nutritional value, and comforting taste. Originating in South America, they have become a staple in countless cuisines. Rich in carbohydrates, fiber, and vitamin C, potatoes provide sustained energy while supporting digestion and immunity. They can be prepared in endless ways\u2014boiled, roasted, mashed, fried, or baked\u2014each method unlocking unique textures and flavors. Potatoes are the base for global favorites such as French fries, mashed potatoes, potato salads, and curries. They also serve as thickening agents in soups and stews. Beyond their role in meals, potatoes hold cultural importance, often symbolizing resilience and sustenance. Different varieties, from russet to Yukon gold, suit different cooking techniques. Potatoes are affordable, widely available, and adaptable to both humble home cooking and fine dining. Their comforting taste, nutritional contributions, and universal appeal make potatoes one of the most cherished and dependable ingredients in kitchens across the world.","Potatoes"),A.am("Carrots are root vegetables recognized for their bright orange color, natural sweetness, and nutritional richness. They are an excellent source of beta-carotene, which the body converts into vitamin A to support vision and immune health. Carrots can be eaten raw, juiced, or cooked, appearing in salads, soups, stir-fries, and even desserts like carrot cake. Their natural sweetness intensifies when roasted or glazed, making them a favorite in side dishes. Carrots come in many colors beyond orange, including purple, yellow, and red, each offering unique antioxidants. They are easy to store, affordable, and widely available, making them a kitchen essential. Carrots also carry cultural symbolism, often associated with health, growth, and vitality. Their crunch, sweetness, and adaptability in both savory and sweet dishes ensure their popularity across cuisines. Nutritious, versatile, and colorful, carrots continue to bring both flavor and health benefits to meals worldwide.","Carrots"),A.am("Cucumbers are refreshing vegetables known for their high water content, crisp texture, and cooling effect. Low in calories but rich in hydration, cucumbers are an ideal food for maintaining fluid balance, especially in hot climates. They are commonly eaten raw in salads, sandwiches, or dips, adding crunch and freshness. In cooking, cucumbers are pickled to create tangy condiments enjoyed worldwide. Nutritionally, cucumbers provide small amounts of vitamin K, potassium, and antioxidants, contributing to heart health and skin vitality. Their light, neutral flavor allows them to complement a wide range of dishes. Beyond the kitchen, cucumbers are valued in skincare, often used to soothe and hydrate the skin. Symbolically, they are linked to refreshment and renewal. Whether sliced into a summer salad, blended into a smoothie, or fermented into pickles, cucumbers offer a simple yet powerful way to enhance both flavor and health in everyday meals.","Cucumber"),A.am("Celery is a crunchy, aromatic vegetable valued for its distinct flavor and nutritional benefits. It is low in calories yet packed with fiber, vitamin K, and antioxidants, making it a healthful addition to many diets. Celery is used in soups, stews, and salads, often forming part of flavor bases like mirepoix in French cuisine. Its crisp stalks are also enjoyed raw with dips or spreads, providing a refreshing snack. Celery leaves and seeds are equally useful, contributing to soups, seasonings, and herbal remedies. Its slightly peppery, earthy taste balances richer ingredients, adding freshness and depth to dishes. Culturally, celery has long been associated with medicinal uses, particularly for digestion and hydration. Its versatility in both raw and cooked forms, along with its subtle yet distinctive flavor, makes celery a kitchen essential. From crunchy snacks to hearty broths, celery enhances both the taste and nutrition of countless recipes worldwide.","Celery"),A.am("Soy sauce is a dark, salty, and umami-rich condiment made by fermenting soybeans, wheat, salt, and water. Originating in China, it has become a cornerstone of East Asian cuisines and is now used worldwide. Its deep, savory flavor enhances stir-fries, marinades, dipping sauces, and soups. Soy sauce comes in many varieties, including light, dark, and tamari, each with unique intensity and uses. Beyond taste, it also contributes to color and aroma in dishes. Nutritionally, soy sauce provides small amounts of protein, antioxidants, and minerals, though it is high in sodium, so moderation is recommended. Beyond cooking, soy sauce has cultural significance, symbolizing tradition and craftsmanship passed down for centuries. Its unique balance of salty, sweet, bitter, and umami flavors makes it a versatile seasoning. Whether splashed over rice, blended into dressings, or simmered into broths, soy sauce remains one of the most iconic and indispensable flavor enhancers in global cuisine.","Soy Sauce"),A.am("Fish sauce is a pungent, salty condiment made from fermented fish and salt, widely used in Southeast Asian cuisines. Despite its strong aroma, it delivers a deep umami flavor that enhances countless dishes. Commonly added to stir-fries, curries, soups, and dipping sauces, fish sauce balances sweet, sour, and spicy elements, creating complex and satisfying flavors. Rich in amino acids, it adds depth similar to soy sauce but with a distinct marine character. Each region has its own style of fish sauce, with Vietnamese and Thai versions being especially famous. It is often paired with lime, chili, and garlic in sauces that accompany grilled meats or fresh vegetables. Beyond flavor, fish sauce carries cultural heritage, connecting modern cooking with ancient fermentation traditions. Its unique taste may seem intense at first, but when blended into recipes, it provides an unmatched savory richness. Essential in Southeast Asian cooking, fish sauce transforms dishes into bold, flavorful experiences.","Fish Sauce"),A.am("Mayonnaise is a creamy condiment made from emulsifying egg yolks, oil, and an acid like vinegar or lemon juice. Known for its smooth texture and rich flavor, mayonnaise is a staple in sandwiches, burgers, salads, and dipping sauces. It serves as the base for many other condiments, including aioli and tartar sauce. Its unique emulsification gives it a luxurious consistency, binding ingredients together in dishes like potato salad and coleslaw. Beyond its role as a spread, mayonnaise enhances moisture in baked goods and adds richness to marinades. Different versions exist worldwide, from Japanese Kewpie mayo with its umami notes to spiced or flavored varieties. While calorie-dense, mayonnaise provides essential fats that contribute to satiety. It also carries cultural importance, often featured in festive dishes and comfort foods. Loved for its creamy texture and versatility, mayonnaise remains one of the most popular condiments, elevating both everyday meals and gourmet creations with ease.","Mayonnaise"),A.am("Tripe is a type of edible lining from the stomachs of various farm animals. Most tripe is from cattle and sheep.","Tripe"),A.am("The domestic goat or simply goat (Capra aegagrus hircus) is a subspecies of C. aegagrus domesticated from the wild goat of Southwest Asia and Eastern Europe. The goat is a member of the animal family Bovidae and the goat\u2014antelope subfamily Caprinae, meaning it is closely related to the sheep. There are over 300 distinct breeds of goat. Goats are one of the oldest domesticated species of animal, and have been used for milk, meat, fur, and skins across much of the world. Milk from goats is often turned into goat cheese.","Goat Meat"),A.am("The black turtle bean is a small, shiny variety of the common bean (Phaseolus vulgaris) especially popular in Latin American cuisine, though it can also be found in the Cajun and Creole cuisines of south Louisiana. Like most common beans, it is native to the Americas, but has been introduced around the world. It is also used in East Indian cooking, Punjabi cuisine, and in Maharashtrian cuisine, it is known as Kala Ghevada. It is used interchangeably with vigna mungo (black gram) in countries such as the United States. The black turtle bean is often simply called the black bean (frijoles negros, zaragoza, jud\xeda negra, poroto negro, or caraota o habichuela negra in Spanish; and feij\xe3o preto in Portuguese), although this terminology can cause confusion with other black beans.","Black Beans"),A.am("Anchovies are tiny, silvery fish that come from the Mediterranean and southern European coasts. They're sold salt-cured, usually oil-packed, and filleted. Commonly they come either flat or rolled in cans or jars, or ground and mixed with oil or butter to make a paste that is sold in tubes. On their own, anchovies are very salty but mixed into sauces, dressings, or pastas they add a wonderful depth of flavor.","Anchovy Fillet"),A.am('Ras el hanout or rass el hanout (Arabic: \u0631\u0627\u0633 \u0627\u0644\u062d\u0627\u0646\u0648\u062a\u200e ra\u02bes al-\u1e25\u0101n\u016bt, pronounced [r\u0251\u0294s \xe6l\u0127\u0251\u02d0nu\u02d0t] (About this soundlisten)) is a spice mix found in varying forms in Tunisia, Algeria, and Morocco.[1] It plays a similar role in North African cuisine as garam masala does in Indian cuisine. The name in Arabic means "head of the shop" and implies a mixture of the best spices the seller has to offer. Ras el hanout is used in many savory dishes, sometimes rubbed on meat or fish, or stirred into couscous or rice. There is no definitive composition of spices that makes up ras el hanout. Each shop, company, or family may have their own blend. The mixture usually consists of over a dozen spices, in different proportions. Commonly used ingredients include cardamom, cumin, clove, cinnamon, nutmeg, mace, allspice, dry ginger, chili peppers, coriander seed, peppercorn, sweet and hot paprika, fenugreek, and dry turmeric. Some spices may be particular to the region, such as ash berries, chufa, grains of paradise, orris root, monk\'s pepper, cubebs, dried rosebud, fennel seed or aniseed, galangal, long pepper. Ingredients may be toasted before being ground or pounded in a mortar and mixed together. Some preparations include salt or sugar, but that is generally not the accepted practice. Garlic, saffron, nuts or dry herbs are generally not included, as they are usually added to dishes individually, but some commercial preparations, particularly in Europe and North America, may contain them. The composition of ras el hanout differs somewhat from the Baharat spice mix, but they differ more by the types of dishes they are associated with and by region rather than the ingredients in them. Although used by Berber people, it should not be confused with "berbere" spice mix from Ethiopia. Certain supposed aphrodisiacs, including the notoriously dangerous "green metallic beetles", cantharides, have appeared in many Moroccan prescriptions, but these seem to be irrelevant for flavouring purposes.',"Ras El Hanout"),A.am('Filo or phyllo (Greek: \u03c6\u03cd\u03bb\u03bb\u03bf "leaf") is a very thin unleavened dough used for making pastries such as baklava and b\xf6rek in Middle Eastern and Balkan cuisines. Filo-based pastries are made by layering many sheets of filo brushed with oil or butter; the pastry is then baked.',"Filo Pastry"),A.am("Orange flower water, or orange blossom water, is the clear, perfumed by-product of the distillation of fresh bitter-orange blossoms for their essential oil. Uses Mediterranean Relief.jpg This essential water has traditionally been used as an aromatizer in many Mediterranean traditional dessert dishes, such as in France for the gibassier and pompe \xe0 l'huile or in Spain for the Rosc\xf3n de Reyes (King cake), or the Samsa in Tunisia or in Moroccan coffee, but has more recently found its way into other cuisines. For example, orange flower water is used in Europe to flavor madeleines, in Mexico to flavor little wedding cakes and Pan de muerto, and in the United States to make orange blossom scones and marshmallows. Orange flower water is also used as an ingredient in some cocktails, such as the Ramos Gin Fizz. In Malta and many North African as well as Middle Eastern countries, orange blossom water is widely used as medicine for stomach ache and given to small children as well as adults. Orange flower water has been a traditional ingredient used often in North African as well as in Middle Eastern cooking. In Arab variants of baklava, orange blossom water is often mixed with the sweet syrup for flavor. Orange blossoms are believed to be used in this manner because they are seen as the traditional bridal flower and, therefore, symbolize purity (white, small and delicate). It is also added to plain water in the Middle East to mask high mineral content and other unpleasant flavors (e.g. those arising from storage in a qulla, a type of clay jug that keeps water cool in a manner similar to the zeer); some add the fragrance irrespective of the taste of the plain water.","Orange Blossom Water"),A.am("Candied fruit, also known as crystallized fruit or glac\xe9 fruit, has existed since the 14th century. Whole fruit, smaller pieces of fruit, or pieces of peel, are placed in heated sugar syrup, which absorbs the moisture from within the fruit and eventually preserves it.","Candied Peel"),A.am("Grand Marnier is a French brand of liqueurs. The brand's best-known product is Grand Marnier Cordon Rouge, an orange-flavored liqueur created in 1880 by Alexandre Marnier-Lapostolle. It is made from a blend of Cognac brandy, distilled essence of bitter orange, and sugar. Grand Marnier Cordon Rouge is 40% alcohol.","Grand Marnier"),A.am("Sherry is a fortified wine made from white grapes that are grown near the city of Jerez de la Frontera in Andalusia, Spain.","Sherry"),A.am("Rose water is a flavoured water made by steeping rose petals in water. Additionally, it is the hydrosol portion of the distillate of rose petals, a by-product of the production of rose oil for use in perfume. It is used to flavour food, as a component in some cosmetic and medical preparations, and for religious purposes throughout Europe and Asia.","Rose Water"),A.am("Mixed spice, also called pudding spice, is a British[1] blend of sweet spices, similar to the pumpkin pie spice used in the United States. Cinnamon is the dominant flavour, with nutmeg and allspice. It is often used in baking, or to complement fruits or other sweet foods.","Mixed Spice"),A.am("Mincemeat is a mixture of chopped dried fruit, distilled spirits and spices, and sometimes beef suet, beef, or venison. Originally, mincemeat always contained meat. Many modern recipes contain beef suet, though vegetable shortening is sometimes used in its place.","Mincemeat"),A.am("The sweet potato or sweetpotato is a dicotyledonous plant that belongs to the bindweed or morning glory family, Convolvulaceae. Its large, starchy, sweet-tasting, tuberous roots are a root vegetable. The young leaves and shoots are sometimes eaten as greens.","Sweet Potatoes"),A.am("A roll is a small, usually round or oblong individual loaf of bread served as a meal accompaniment (eaten plain or with butter) A roll can be served and eaten whole or cut transversely and dressed with filling between the two halves. Rolls are also commonly used to make sandwiches similar to those produced using slices of bread. They are found in most cuisines all over the world. In the Deipnosophistae, the author Athenaeus (c. 170 \u2013 c. 230) describes some of the bread, cakes, and pastries available in the Classical world. Among the breads mentioned are griddle cakes, honey-and-oil bread, mushroom-shaped loaves covered in poppy seeds, and the military specialty of rolls baked on a spit.","Bread Rolls"),A.am("A bun is a small, sometimes sweet, bread-based item[1] or roll. Though they come in many shapes and sizes, they are most commonly hand-sized or smaller, with a round top and flat bottom.","Buns"),A.am("Ground meat, called mince or minced meat outside of North America (i.e. in U.K. and Commonwealth countries), and keema or qeema (Hindustani: \u0915\u093c\u0940\u092e\u093e (Devanagari), \u0642\u06cc\u0645\u06c1 (Nastaleeq), (pronounced [\u02c8qi\u02d0ma\u02d0])) in the Indian subcontinent, is meat finely chopped by a meat grinder or a chopping knife. A common type of ground meat is ground beef, but many other types of meats are prepared in a similar fashion, including pork, lamb, and poultry. In the Indian subcontinent, both mutton and goat meat are also minced to produce keema.","Ground Meat"),A.am("A pork chop, like other meat chops, is a loin cut taken perpendicular to the spine of the pig and usually containing a rib or part of a vertebra. Pork chops are not processed and are leaner than other cuts of pork. Chops are commonly served as an individual portion.","Pork Chops"),A.am("Yukon Gold is a large cultivar of potato most distinctly characterized by its thin, smooth, eye-free skin and yellow-tinged flesh. This potato was developed in the 1960s by Garnet Johnston in Guelph, Ontario, Canada, with the help of Geoff Rowberry at the University of Guelph. The official cross was made in 1966 and Yukon Gold was finally released into the market in 1980.","Yukon Gold Potatoes"),A.am("The brown onion or yellow onion is a variety of dry onion with a strong flavour. They have a greenish-white, light yellow, or white inside; its layers of papery skin have a yellow-brown or pale golden colour","Yellow Onion"),A.am("Sriracha is a type of hot sauce or chili sauce made from a paste of chili peppers, distilled vinegar, garlic, sugar, and salt.","Sriracha"),A.am("Chilli peppers are one of the most iconic spices in world cuisine, known for their fiery heat and vibrant flavor. Belonging to the Capsicum family, chillies come in countless varieties, ranging from mild and slightly sweet to intensely hot. Their spiciness comes from capsaicin, a natural compound concentrated in the seeds and inner membranes, which stimulates the nerves in the mouth and creates the familiar burning sensation. Beyond heat, chillies also add depth, smokiness, and even a fruity undertone depending on the type used. They are a staple in Asian, Latin American, African, and Mediterranean cooking, appearing in curries, sauces, marinades, stir-fries, and pickles. Apart from culinary uses, chillies are valued for their health benefits: they boost metabolism, improve circulation, and are rich in vitamin C and antioxidants. Whether fresh, dried, powdered, or made into pastes, chillies are versatile and transformative. A pinch can lift a simple dish, while a handful can create bold, unforgettable flavors.","Chilli"),A.am("Garlic (Allium sativum) is a pungent, aromatic bulb that has been treasured for thousands of years in both cooking and medicine. Each bulb is made up of multiple cloves, which release their signature sharp and savory aroma when crushed, chopped, or cooked. Garlic\u2019s flavor is strong and slightly spicy when raw but mellows into a rich sweetness when roasted or saut\xe9ed. It is a cornerstone ingredient across many cuisines, from Italian pasta sauces and Mediterranean dips to Asian stir-fries, soups, and marinades. Beyond flavor, garlic carries impressive health benefits\u2014it is known to support heart health, strengthen immunity, and act as a natural antibacterial and antifungal agent. Its active compound, allicin, is responsible for both its distinctive smell and its medicinal properties. Garlic is endlessly versatile: it can be blended into sauces, infused into oils, spread as roasted cloves, or simply used to build depth in everyday cooking. With its unique balance of flavor and health, garlic is truly an essential kitchen ingredient.","Garlic"),A.am('Rhubarb is a general term used for the cultivated plants in the genus Rheum in the family Polygonaceae. It is a herbaceous perennial growing from short, thick rhizomes. Historically, different plants have been called "rhubarb" in English.',"Rhubarb"),A.am("Pita or pitta, is a family of yeast-leavened round flatbreads baked from wheat flour, common in the Mediterranean, Middle East, and neighboring areas.","Pita Bread"),A.am("Bulgur is a cereal food made from the cracked parboiled groats of several different wheat species, most often from durum wheat. It originates in Middle Eastern cuisine.","Bulgur Wheat"),A.am("Quinoa is a flowering plant in the amaranth family. It is an herbaceous annual plant grown as a crop primarily for its edible seeds; the seeds are rich in protein, dietary fiber, B vitamins, and dietary minerals in amounts greater than in many grains.","Quinoa"),A.am("A pickled cucumber is a cucumber that has been pickled in a brine, vinegar, or other solution and left to ferment for a period of time, by either immersing the cucumbers in an acidic solution or through souring by lacto-fermentation. Pickled cucumbers are often part of mixed pickles.","Dill Pickles"),A.am("Iceberg is a variety of lettuce with crisp leaves that grow in a spherical head resembling cabbage. It is considered one of the sweeter lettuce varieties like romaine and butterhead. Mature iceberg lettuce grows to about one foot in diameter.","Iceberg Lettuce"),A.am("A relish is a cooked and pickled product made of chopped vegetables, fruits or herbs and is a food item typically used as a condiment to enhance a staple. Examples are chutneys and the North American relish, a pickled cucumber jam eaten with hot dogs or hamburgers.","Gherkin Relish"),A.am("Processed cheese is a food product made from cheese and other unfermented dairy ingredients mixed with emulsifiers. Additional ingredients, such as vegetable oils, salt, food coloring, or sugar may be included. As a result, many flavors, colors, and textures of processed cheese exist.","Cheese Slices"),A.am('Shortening is any fat that is a solid at room temperature and used to make crumbly pastry and other food products. Although butter is solid at room temperature and is frequently used in making pastry, the term "shortening" seldom refers to butter, but is more closely related to margarine.',"Shortening"),A.am("Water is an inorganic, transparent, tasteless, odorless, and nearly colorless chemical substance, which is the main constituent of Earth's hydrosphere and the fluids of most living organisms. It is vital for all known forms of life, even though it provides no calories or organic nutrients. Its chemical formula is H2O, meaning that each of its molecules contains one oxygen and two hydrogen atoms, connected by covalent bonds. Water is the name of the liquid state of H2O at standard ambient temperature and pressure. It forms precipitation in the form of rain and aerosols in the form of fog. Clouds are formed from suspended droplets of water and ice, its solid state. When finely divided, crystalline ice may precipitate in the form of snow. The gaseous state of water is steam or water vapor. Water moves continually through the water cycle of evaporation, transpiration (evapotranspiration), condensation, precipitation, and runoff, usually reaching the sea.","Warm Water"),A.am("Pickling is the process of preserving or extending the shelf life of food by either anaerobic fermentation in brine or immersion in vinegar. In East Asia, vinaigrette is also used as a pickling medium. The pickling procedure typically affects the food's texture, taste and flavor.","Pickle Juice"),A.am("Powdered sugar, also called confectioners' sugar or icing sugar, is a finely ground sugar produced by milling granulated sugar into a powdered state. It usually contains a small amount of anti-caking agent to prevent clumping and improve flow","Powdered Sugar"),A.am("Kielbasa is any type of meat sausage from Poland, and a staple of Polish cuisine. In American English the word typically refers to a coarse, U-shaped smoked sausage of any kind of meat, which closely resembles the Wiejska sausage in British English.","Kielbasa"),A.am("Sauerkraut is finely cut raw cabbage that has been fermented by various lactic acid bacteria. It has a long shelf life and a distinctive sour flavor, both of which result from the lactic acid formed when the bacteria ferment the sugars in the cabbage leaves.","Sauerkraut"),A.am("Caraway, also known as meridian fennel and Persian cumin (Carum carvi), is a biennial plant ... For example, it is used in goulash, sauerkraut, and caraway seed cake. The roots may be cooked as a vegetable like parsnips or carrots","Caraway Seed"),A.am("Herring are forage fish, mostly belonging to the family Clupeidae. Herring often move in large schools around fishing banks and near the coast, found particularly in shallow, temperate waters of the North Pacific and North Atlantic Oceans, including the Baltic Sea, as well as off the west coast of South America.","Herring"),A.am('Fruit preserves are preparations of fruits, vegetables and sugar, often stored in glass jam jars and Mason jars. Many varieties of fruit preserves are made globally, including sweet fruit preserves, such as those made from strawberry or apricot, and savory preserves, such as those made from tomatoes or squash. The ingredients used and how they are prepared determine the type of preserves; jams, jellies, and marmalades are all examples of different styles of fruit preserves that vary based upon the fruit used. In English, the word, in plural form, "preserves" is used to describe all types of jams and jellies.',"Jam"),A.am("As the dietary staple of Japan, knowing how to cook Japanese rice is an important first step to becoming a Japanese cooking master. Perfectly prepared Japanese rice should be light, fluffy, and slightly sticky when cooked","Sushi Rice"),A.am("Ficus carica is an Asian species of flowering plant in the mulberry family, known as the common fig. It is the source of the fruit also called the fig and as such is an important crop in those areas where it is grown commercially.","Figs"),A.am('Cider (/\u02c8sa\u026ad\u0259r/ SY-d\u0259r) is an alcoholic beverage made from the fermented juice of apples. Cider is widely available in the United Kingdom (particularly in the West Country) and the Republic of Ireland. The UK has the world\'s highest per capita consumption, as well as its largest cider-producing companies. Ciders from the South West of England are generally stronger. Cider is also popular in many Commonwealth countries, such as India, Canada, Australia, and New Zealand. As well as the UK and its former colonies, cider is popular in Portugal (mainly in Minho and Madeira), France (particularly Normandy and Brittany), northern Italy (Piedmont and Friuli), and northern Spain (especially the Principality of Asturias and the Basque Country). Central Europe also has its own types of cider with Rhineland-Palatinate and Hesse producing a particularly tart version known as Apfelwein. In the U.S., varieties of fermented cider are often called hard cider to distinguish alcoholic cider from non-alcoholic apple cider or "sweet cider", also made from apples. In Canada, cider cannot be called cider if there are no apples. Furthermore, according to the Food and Drug Regulations in Canada, cider cannot contain less than 2.5% or over 13% absolute alcohol by volume.',"Cider"),A.am("The beetroot is the taproot portion of a beet plant, usually known in Canada and the USA as beets while the vegetable is referred to as beetroot in British English, and also known as the table beet, garden beet, red beet, dinner beet or golden beet.","Beetroot"),A.am('"Sardine" and "pilchard" are common names that refer to various small, oily forage fish in the herring family Clupeidae. The term "sardine" was first used in English during the early 15th century and may come from the Mediterranean island of Sardinia, around which sardines were once abundant.',"Sardines"),A.am("Ciabatta is an Italian white bread made from wheat flour, water, salt, yeast and olive oil, created in 1982 by a baker in Adria, province of Rovigo, Veneto, Italy, in response to the popularity of French baguettes.","Ciabatta"),A.am("Buckwheat (Fagopyrum esculentum), or common buckwheat, is a plant cultivated for its grain-like seeds and as a cover crop. The name \"buckwheat\" is used for several other species, such as Fagopyrum tataricum, a domesticated food plant raised in Asia. Despite the name, buckwheat is not closely related to wheat, as it is not a grass. Instead, buckwheat is related to sorrel, knotweed, and rhubarb. Buckwheat is referred to as a pseudocereal because its seeds' culinary use is the same as cereals', owing to their composition of complex carbohydrates.","Buckwheat"),A.am('A prune is a dried plum, most commonly from the European plum. Not all plum species or varieties can be dried into prunes. A prune is the firm-fleshed fruit (plum) of Prunus domestica varieties that have a high soluble solids content, and do not ferment during drying. Use of the term "prune" for fresh plums is obsolete except when applied to varieties of plum grown for drying.',"Prunes")],A.ag("D<eG>")))
